import React from 'react';

const PlayerGrid = ({players}) => (
  <ul className="players">
    {players.map(player => (
      <li>
        <img src="https://www.thesportsdb.com/images\/media\/player\/thumb\/82uics1544986067.jpg" />
        {player.strTeam}
        {player.strNationality}
      </li>))}
  </ul>
);

export default PlayerGrid;
